import React from 'react';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import { Container, Typography, Button, Grid, Link, Avatar, Box } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';

function Welcome() {
  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography variant="h5" component="h1" align="center" gutterBottom>
          Welcome
        </Typography>
        <Button
          component={RouterLink} // Utilizăm componenta RouterLink pentru a redirecționa la pagina de autentificare
          to="/login"
          fullWidth
          variant="contained"
          sx={{ mt: 3, mb: 2 }}
        >
          Connect
        </Button>
      </Box>
    </Container>
  );
}

export default Welcome;
